export const fetchPhotos = () => {
  try {
    const response = fetch("http://test-backend.itdelta.agency/api/images")
    const result = response.then((result) => result)
    console.log(result)
    console.log(null ? true : false)
    return result
  } catch (error) {
    throw new Error(error)
  }
}
